DROP TABLE IF EXISTS `armor`;
CREATE TABLE `armor` (
  `item_id` MEDIUMINT UNSIGNED NOT NULL DEFAULT 0,
  `name` VARCHAR(120) NOT NULL DEFAULT '',
  `bodypart` VARCHAR(15) NOT NULL DEFAULT 'none',
  `crystallizable` VARCHAR(5) NOT NULL DEFAULT 'false',
  `armor_type` VARCHAR(5) NOT NULL DEFAULT 'none',
  `weight` MEDIUMINT(5) NOT NULL DEFAULT 0,
  `material` VARCHAR(15) NOT NULL DEFAULT 'wood',
  `crystal_type` VARCHAR(4) NOT NULL DEFAULT 'none',
  `avoid_modify` TINYINT(1) NOT NULL DEFAULT 0,
  `duration` SMALLINT(3) NOT NULL DEFAULT -1,           -- duration in minutes for shadow items
  `time` MEDIUMINT(6) NOT NULL DEFAULT -1,              -- duration in minutes for time limited items
  `p_def` SMALLINT(3) NOT NULL DEFAULT 0,
  `m_def` TINYINT(2) NOT NULL DEFAULT 0,
  `mp_bonus` SMALLINT(3) NOT NULL DEFAULT 0,
  `price` INT UNSIGNED NOT NULL DEFAULT 0,
  `crystal_count` SMALLINT(4) UNSIGNED NOT NULL DEFAULT 0,
  `sellable` VARCHAR(5) NOT NULL DEFAULT 'false',
  `dropable` VARCHAR(5) NOT NULL DEFAULT 'false',
  `destroyable` VARCHAR(5) NOT NULL DEFAULT 'true',
  `tradeable` VARCHAR(5) NOT NULL DEFAULT 'false',
  `depositable` VARCHAR(5) NOT NULL DEFAULT 'true',
  `enchant4_skill` VARCHAR(8) NOT NULL DEFAULT '',
  `skills_item` VARCHAR(70) NOT NULL DEFAULT '',
  PRIMARY KEY (`item_id`)
) DEFAULT CHARSET=utf8;



-- Just in case someone screws something up or misses something,these scripts will fix a few things.
UPDATE `armor` SET crystallizable = "false",destroyable = "true" WHERE (bodypart = "face") or (bodypart = "hair") or (bodypart = "hairall");

UPDATE `armor` SET bodypart = "lbracelet",crystallizable = "false",sellable = "false",dropable = "false",destroyable = "true",tradeable = "false" WHERE (name LIKE "%mounting%") or (name LIKE "%Agathion%");
UPDATE `armor` SET bodypart = "talisman",crystallizable = "false",sellable = "false",dropable = "false",destroyable = "true",tradeable = "false" WHERE name LIKE "%Talisman%";

UPDATE `armor` SET time = "60" WHERE (name LIKE '%1 hour%') or (name LIKE '%1-hour%');
UPDATE `armor` SET time = "180" WHERE (name LIKE '%3 hour%') or (name LIKE '%3-hour%');
UPDATE `armor` SET time = "1440" WHERE (name LIKE '%24 hour%') or (name LIKE '%24-hour%');
UPDATE `armor` SET time = "4320" WHERE (name LIKE '%3 Day%') or (name LIKE '%3-Day%');
UPDATE `armor` SET time = "10080" WHERE (name LIKE '%7 Day%') or (name LIKE '%7-Day%');
UPDATE `armor` SET time = "21600" WHERE (name LIKE '%15 Day%') or (name LIKE '%15-Day%');
UPDATE `armor` SET time = "43200" WHERE (name LIKE '%30 Day%') or (name LIKE '%30-Day%');

-- PvP Armors can not be traded,or dropped,or shipped,or sold. Just like augmented items but with more restrictions.
UPDATE `armor` SET sellable = "false",dropable = "false",tradeable = "false" WHERE name LIKE '%{PvP}%';

